-- ----------------------------
-- Procedure structure for activity_state
-- ----------------------------
DROP PROCEDURE IF EXISTS `activity_state`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `activity_state`()
BEGIN
	SET @var_current_date = CURDATE();
	SET @var_current_time = CONCAT(CURDATE(),' ',CURTIME());
	UPDATE activity_info SET activity_state = 1 , gmt_update = @var_current_time WHERE @var_current_date >= activity_date_begin and @var_current_date <= activity_date_end;
 	UPDATE activity_info SET activity_state = 2 , gmt_update = @var_current_time WHERE @var_current_date > activity_date_end;
END
;;
delimiter ;

-- ----------------------------
-- Event structure for change_activity_state
-- ----------------------------
DROP EVENT IF EXISTS `change_activity_state`;
delimiter ;;
CREATE DEFINER = `root`@`localhost` EVENT `change_activity_state`
ON SCHEDULE
EVERY '1' DAY STARTS '2020-03-17 00:00:30'
DO CALL activity_state()
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
